						malls.map((user, i) => {
							return (
								<Card
								key={i}
								id={malls[i].id}
								image={malls[i].image}
								name={malls[i].name}
								address={gundams[i].faction}


								/>
								);
						})
					}
				</div>
		);
}

export default CardList;
